- input: 'TEXT,F3XA,,"This amendment is in response to a Request for Additional Information
    letter on our Year End Report. The items are addressed as follows: 1.  Schedule
    A reports memo entries from ASDC Dollars for Democrats totaling $26901.50 but
    doe not disclose any transfers in this quarter from them.  This is due to the
    fact that the ASDC D4D only sends us funds when we request them thus if we don''t
    receive funds from them with in the quarter we still receive the lists of who
    contributed. We did not request any funds from Dollars for Democrats in the last
    quarter of 2004. 2. The receipt on Line 11(c) from Friends of John Tanner was
    a transfer and has been labeled as such. 3. The negative entry on line 21(b) was
    not a refund but rather an American Express credit to our account from a disputed
    charge.  4. The two transfers to our non-federal account were for cash-flow purposes.",'
  record: <fec.version.v5_2.TEXT.Records instance at 0x27b4b48>
  result:
  - name: REC TYPE
    number: '1'
    value: TEXT
  - name: FORM TYPE
    number: '2'
    value: F3XA
  - name: BACK REF TRAN ID
    number: '3'
    value: ''
  - name: TEXT4000
    number: '4'
    value: 'This amendment is in response to a Request for Additional Information
      letter on our Year End Report. The items are addressed as follows: 1.  Schedule
      A reports memo entries from ASDC Dollars for Democrats totaling $26901.50 but
      doe not disclose any transfers in this quarter from them.  This is due to the
      fact that the ASDC D4D only sends us funds when we request them thus if we don''t
      receive funds from them with in the quarter we still receive the lists of who
      contributed. We did not request any funds from Dollars for Democrats in the
      last quarter of 2004. 2. The receipt on Line 11(c) from Friends of John Tanner
      was a transfer and has been labeled as such. 3. The negative entry on line 21(b)
      was not a refund but rather an American Express credit to our account from a
      disputed charge.  4. The two transfers to our non-federal account were for cash-flow
      purposes.'
  - name: AMENDED CD
    number: '5'
    value: ''
